Reproducer (build with -O2):

#define _FORTIFY_SOURCE 2
#include <string>
#include <stdio.h>

void __attribute__((weak))
test(const char *a, const char *b)
{
  std::string mu = a;
  std::string lu = b;
  char buf[256];
  sprintf(buf, "U %s %s", mu.c_str(), lu.c_str());
  puts(buf);
}

int
main()
{
  test("GEV", "MM");
}

